import React, { useState, useEffect } from "react";
import axios from "axios";
import { useForm } from "react-hook-form";
import { useNavigate } from "react-router-dom";
import { useSelector } from "react-redux";

const OwnerHome = () => {
  const [cars, setCars] = useState([]);
  const [editingCar, setEditingCar] = useState(null);
  const [successMessage, setSuccessMessage] = useState("");
  const [errorMessage, setErrorMessage] = useState("");

  const {
    register,
    handleSubmit,
    reset,
    formState: { errors },
  } = useForm();

  const navigate = useNavigate();
  const owner = useSelector((state) => state.auth.user);

  useEffect(() => {
    if (!owner) {
      navigate("/login");
      return;
    }
    fetchCars();
  }, [owner, navigate]);

  const fetchCars = async () => {
    try {
      const response = await axios.get(`http://localhost:8080/getCarByAgentId/${owner.id}`);
      setCars(response.data);
    } catch (error) {
      console.error("Error fetching cars:", error);
      setErrorMessage("Failed to fetch cars.");
    }
  };

  const handleAddOrUpdateCar = async (data) => {
    const carData = {
      ...data,
      ownerId: owner.id,
    };

    try {
      if (editingCar) {
        await axios.put(
          `http://localhost:8080/api/cars/${editingCar.carId}`,
          carData
        );
        setSuccessMessage("Car updated successfully!");
      } else {
        await axios.post("http://localhost:8080/cars/api/", carData);
        setSuccessMessage("Car added successfully!");
      }
      fetchCars();
      reset();
      setEditingCar(null);
    } catch (error) {
      console.error("Error saving car:", error);
      setErrorMessage("Failed to save car.");
    }
  };

  const handleEditCar = (car) => {
    setEditingCar(car);
    reset(car);
  };

  const handleDeleteCar = async (carId) => {
    try {
      await axios.delete(`http://localhost:8080/api/cars/${carId}`);
      setSuccessMessage("Car deleted successfully!");
      fetchCars();
    } catch (error) {
      console.error("Error deleting car:", error);
      setErrorMessage("Failed to delete car.");
    }
  };

  return (
    <div className="container mt-5">
      <h2 className="text-center mb-4">Owner Home</h2>

      {successMessage && (
        <div className="alert alert-success" role="alert">
          {successMessage}
        </div>
      )}
      {errorMessage && (
        <div className="alert alert-danger" role="alert">
          {errorMessage}
        </div>
      )}

      <form
        onSubmit={handleSubmit(handleAddOrUpdateCar)}
        className="p-4 shadow rounded bg-white mb-4"
      >
        <h4>{editingCar ? "Edit Car" : "Add New Car"}</h4>

        <div className="mb-3">
          <label htmlFor="model" className="form-label">
            Car Model
          </label>
          <input
            type="text"
            className="form-control"
            id="model"
            {...register("model", { required: "Car model is required" })}
          />
          {errors.model && (
            <p className="text-danger">{errors.model.message}</p>
          )}
        </div>

        <div className="mb-3">
          <label htmlFor="registrationNumber" className="form-label">
            Registration Number
          </label>
          <input
            type="text"
            className="form-control"
            id="registrationNumber"
            {...register("registrationNumber", {
              required: "Registration number is required",
            })}
          />
          {errors.registrationNumber && (
            <p className="text-danger">{errors.registrationNumber.message}</p>
          )}
        </div>

        <button type="submit" className="btn btn-primary w-100">
          {editingCar ? "Update Car" : "Add Car"}
        </button>
      </form>

      <h4 className="mb-3">Cars List</h4>
      <table className="table table-bordered">
        <thead>
          <tr>
            <th>Car ID</th>
            <th>Model</th>
            <th>Registration Number</th>
            <th>Actions</th>
          </tr>
        </thead>
        <tbody>
          {cars.map((car) => (
            <tr key={car.carId}>
              <td>{car.carId}</td>
              <td>{car.model}</td>
              <td>{car.registrationNumber}</td>
              <td>
                <button
                  className="btn btn-sm btn-warning me-2"
                  onClick={() => handleEditCar(car)}
                >
                  Edit
                </button>
                <button
                  className="btn btn-sm btn-danger"
                  onClick={() => handleDeleteCar(car.carId)}
                >
                  Delete
                </button>
              </td>
            </tr>
          ))}
        </tbody>
      </table>
    </div>
  );
};

export default OwnerHome;
